let isPlaying = false;
let volume = 0.2;

export function scratch() {
  if (!isPlaying) {
    isPlaying = true;
    var sound = new Audio("data:audio/wav;base64," + audioBase64);
    sound.volume = volume;
    sound.play();

    // Set timeout to reset the flag after 4 seconds (adjust as needed)
    setTimeout(() => {
      isPlaying = false;
    }, 600);
  }
}

export function setVolume(vol: number) {
    if (vol >= 0 && vol <= 1) {
        volume = vol;
    }
}

const audioBase64 = ''